formance.', 'comment_created': datetime.datetime(2022, 7, 19, 17, 2, 55, tzinfo=datetime.timezone.utc), 'commenter': 'filipinascimento', 'type': 'User'}, {'comment_id': 925538827, 'comment_body': "@filipinascimento I think it would be better to have both functionalities. We have seen how some things break when there's a major release of VTK, especially things related to shaders. If that happens in the future, we'll just change the default parameter to the original functionality while we fix the shaders.

Regarding the properties, the purpose of changing the dot actor in #584 was precisely this, using a new dot actor as the basis for a GS version of the billboard. In that case, the colors are handled by the polydata in the dot actor.", 'comment_created': datetime.datetime(2022, 7, 20, 12, 20, 47, tzinfo=datetime.timezone.utc), 'commenter': 'guaje', 'type': 'User'}, {'comment_id': 938319848, 'comment_body': 'Use `fury/shaders/lighting/blinn_phong_model.frag` as in #587 and #620', 'comment_created': datetime.datetime(2022, 8, 4, 23, 8, 6, tzinfo=datetime.timezone.utc), 'commenter': 'guaje', 'type': 'User'}, {'comment_id': 938322697, 'comment_body': "GLSL is a C-like language and uses the camel case naming convention. Fury also sticks to VTK's naming convention, so this should be `scaleVSOutput`.

