atetime.timezone.utc), 'commenter': 'guaje', 'type': 'User'}, {'comment_id': 938341099, 'comment_body': 'Add support to the custom shaders in the params `fs_dec` and `fs_impl`. As implemented [here](https://github.com/fury-gl/fury/blob/2b2caf849efd2fa894d33be661a8dd3d6679c6b2/fury/actor.py#L2371) and [here](https://github.com/fury-gl/fury/blob/2b2caf849efd2fa894d33be661a8dd3d6679c6b2/fury/actor.py#L2373).', 'comment_created': datetime.datetime(2022, 8, 5, 0, 1, 26, tzinfo=datetime.timezone.utc), 'commenter': 'guaje', 'type': 'User'}, {'comment_id': 938341869, 'comment_body': 'These functions are used in both billboard creation approaches.', 'comment_created': datetime.datetime(2022, 8, 5, 0, 3, 30, tzinfo=datetime.timezone.utc), 'commenter': 'guaje', 'type': 'User'}, {'comment_id': 938342275, 'comment_body': 'Maybe `use_gs` instead of `using_gs`.', 'comment_created': datetime.datetime(2022, 8, 5, 0, 4, 39, tzinfo=datetime.timezone.utc), 'commenter': 'guaje', 'type': 'User'}, {'comment_id': 938345135, 'comment_body': "Given the nature of the new functionality, we should find a way to reuse the `gs_prog` param. Something like:

