pr_body:
Usually, `on_change` hook inside the `LineSlider2D` is used to execute something when the user changes the slider.
If this something involves setting the slider's value, an infinite recursion situation occurs.
@ganimtron-10 mentioned some other sliders behave the same, but the tests of PR #626 are failing because of this issue so I had to make this PR to rebase my PR on it until @skoudoro decides whether we should keep the functionality of the `on_change` hook as it is and make another hook that gets triggered on user interaction with the slider only keep this PR as it is.
